شو يا رفيقي خلص صار فيني قلك إنّو مزحتك ثقيلة هالمرة ؟!!! ١٥ سنة عم نضحك فيها و بكل مهمة نروح عليها لاقيك ورا كاميرتك عم تقلنا "شرّ البلية ما يضحك"… بعد فينا نتسكع بشارع الحمرا و بدارو ؟!! بعد فينا نروح عند الفوال بشارع الحمرا الساعة ٦ الصبح هربانين من الشغل ؟!! كيف فيك تترك الناس يلي بتحبك هالقد…انت و رفقاتنا يلي راحوا قبلك حمزة الحج حسن و أدونيس وعلي شعبان… ما رح تصير صورة منتذكرها لا يا عصام… إنت رمز من رموز الصحافة … أنا رفيقي شهيد … رفيقي يلي ضحكنا كلنا اليوم أبكيتنا… ضربة كبيرة و قاضية يا ملك السلطة الرابعة متل ما كنا نقلك… بقلبي دائما يا رفيقي 
